import React from 'react';
import ReactDOM from 'react-dom/client';



class Router extends React.Component {




  render() {

    const routerInfoList = [
      { id: 0, type: "NPU-1", usage: 94 },
      { id: 1, type: "NPU-0", usage: 70 },
      { id: 2, type: "NPU-0", usage: 2 },
      { id: 3, type: "NPU-1", usage: 35 },
      { id: 4, type: "NPU-0", usage: 99 }
    ];

    const [ { usage1 }, { usage2 } ] = routerInfoList;



    return (
      <div>
        <p>{usage1}</p>
	<p>{usage2}</p>
      </div>
    )
  }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Router />);
